create table token_team
(
    id         bigserial
        constraint token_team_pk
            primary key,
    team       text,
    token_name text
        constraint token_team_crypto_project_name_fk
            references crypto_project (name)
);

alter table token_team
    owner to application;

create unique index token_team_id_uindex
    on token_team (id);

